  {
    SELECT DISTINCT ?militaryForce1 WHERE { ?militaryForce1 ?p ?o . }
  } UNION {
    SELECT DISTINCT ?militaryForce2 WHERE { ?militaryForce2 ?p ?o . }
  } UNION {
    SELECT DISTINCT ?militaryForce3 WHERE { ?militaryForce3 ?p ?o . }
