```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT ?militaryForce ?commander ?war WHERE {
  # Battle of Tamai resource
  ?battle rdf:type dbo:Battle ;
          rdfs:label "Battle of Tamai"@en .

  # Military forces involved in the battle
  ?militaryForce dbo:participatedIn ?battle .

  # Commanders of these military forces
  OPTIONAL { ?militaryForce dbo:commander ?commander . }

  # Wars related to the battle
  ?war dbo:partOfWar ?battle ;
       rdf:type dbo:MilitaryConflict, dbo:SocietalEvent .

  # Optional reference to A Battery, Royal Australian Artillery
  OPTIONAL {
    ?reference dbo:member ?militaryForce ;
               rdfs:label "A Battery, Royal Australian Artillery"@en .
  }
}
```

