SELECT ?spouse ?royalChild ?childOfChristianX
WHERE {
  # Find the spouse of Princess Caroline-Mathilde of Denmark
  ?princess rdf:type dbo:Person ;
            rdfs:label "Princess Caroline-Mathilde of Denmark"@en .
  ?princess dbo:spouse ?spouse .

  # Identify a child of Frederick Francis III who is royalty
  ?frederickFrancisIII rdf:type dbo:Person ;
                       rdfs:label "Frederick Francis III, Grand Duke of Mecklenburg-Schwerin"@en .
  ?childOfFrederickFrancisIII dbo:parent ?frederickFrancisIII ;
                             rdf:type dbo:RoyalFamilyMember .

  # Check if this child is also a child of Christian X of Denmark
  ?christianX rdf:type dbo:Person ;
              rdfs:label "Christian X of Denmark"@en .
  OPTIONAL {
    ?childOfFrederickFrancisIII dbo:parent ?christianX .
  }

  # Ensure the child is royalty and link to a child of Christian X if applicable
  FILTER EXISTS { ?childOfFrederickFrancisIII rdf:type dbo:RoyalFamilyMember }
}
