PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?person ?team WHERE {
  ?person rdf:type dbo:SoccerPlayer ;
          dbo:sportManagerOf ?team ;
          dbo:occupation "Soccer Manager" .

  FILTER EXISTS { ?person dbo:birthDate ?birthDate . }
  FILTER EXISTS { ?person dbo:deathDate ?deathDate . }

  # Assuming we have the date of Pavel Vezhinov's death
  BIND (xsd:date("2008-11-23") AS ?vezhinovDeathDate)

  # Ensure the person was alive at the time of Pavel Vezhinov's death
  FILTER (?birthDate < ?vezhinovDeathDate)
  FILTER NOT EXISTS { ?person dbo:deathDate ?d WHERE ?d <= ?vezhinovDeathDate }

  # Find Pavel Vezhinov to ensure we are using his correct date of death
  ?vezhinov dbo:deathDate ?vezhinovDeathDate .
  BIND (dbr:Pavel_Vezhinov AS ?vezhinov)
}
